import React from 'react'
import Button from 'react-bootstrap/Button'



export default function Pagination({goNext, goPrev}) {
    return (
        <div className="d-flex justify-content-center">            
            {goPrev && <Button variant="success" className="d-flex justify-content-around" onClick={goPrev}>Previous</Button>}
            <h4 class="bg-gradient-primary text-white">.</h4>
            {goNext && <Button variant="primary" onClick={goNext}>Next</Button>}            
        </div>
    )
}
